import React from 'react';
import './MuscleMap.css';

const MuscleMap = ({ onSelect }) => {
  return (
    <div className="muscle-map-container">
      <svg
        viewBox="0 0 1000 1000"
        xmlns="http://www.w3.org/2000/svg"
        className="muscle-svg"
      >
        {/* Example clickable muscle areas */}
        <path
          id="pectoralis_major"
          d="M300,200 L400,200 L400,300 L300,300 Z"
          onClick={() => onSelect('pectoralis_major')}
          className="muscle"
        />
        <path
          id="quadriceps"
          d="M350,500 L380,500 L380,650 L350,650 Z"
          onClick={() => onSelect('quadriceps')}
          className="muscle"
        />
        {/* Add more paths from the original file */}
      </svg>
    </div>
  );
};

export default MuscleMap;
